import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Signin from './Component/Auth/Signin'

function App() {

  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={Signin} exact />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
